import React from "react";
import bg from "../images/servicebg.avif";
function Services() {
  return (
    <div>
      <div
        className="bg-gradient-to-l hover:bg-gradient-to-r"
        style={{
          backgroundImage: `url(${bg})`,
          width: "100%",
          height: "100vh",
          position: "relative",
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        <div className="t">
          <h1>Hello, World!</h1>
          {/* Your content goes here */}
        </div>
      </div>
      <div className="bg-red w-5 h-5 border-r-2">
        <h1 className="mt-[-50px]">helllllllllll</h1>
      </div>
    </div>
  );
}

export default Services;
